import React from 'react';



const CreatureCard = ({ name, location, type, price }) => {
    return (
        <div className="card-styling">
            <h1
                className="creature-name">
                {name}
            </h1>
            <p className="type">
                Type: {type}
            </p>
            <p
                className="location">
                Location: {location}
            </p>

            <p className="price">
            Price: {[price-nook]} 
            </p>

        </div>
    );
};


export default CreatureCard;
